import { Post } from "../Post/Post";
import "./Blogs.css";
import { useState, useEffect } from "react";
import useFetch from "../../custom hooks/useFetch";

export const Blogs = () => {
  const [data] = useFetch("http://localhost:5002/api/posts/allposts");
  console.log(data);

  return (
    <div className="Blogs">
      {data.map((index) => {
        return (
          <Post
            key={index.id}
            title={index.title}
            img={index.image}
            description={index.Desc}
          />
        );
      })}
    </div>
  );
};
